import React from 'react';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { User, Target, Award, Heart } from 'lucide-react';

const About: React.FC = () => {
  const [ref, inView] = useInView({
    triggerOnce: true,
    threshold: 0.1,
  });

  const skills = [
    'React', 'TypeScript', 'Node.js', 'Python', 'UI/UX Design', 'Git',
    'AWS', 'Docker', 'MongoDB', 'PostgreSQL', 'REST APIs', 'GraphQL'
  ];

  const values = [
    {
      icon: <Target className="w-6 h-6" />,
      title: 'Goal-Oriented',
      description: 'Focused on delivering results that exceed expectations'
    },
    {
      icon: <Award className="w-6 h-6" />,
      title: 'Excellence',
      description: 'Committed to producing high-quality work in everything I do'
    },
    {
      icon: <Heart className="w-6 h-6" />,
      title: 'Passion',
      description: 'Genuine enthusiasm for creating meaningful digital experiences'
    }
  ];

  return (
    <section id="about" className="section-padding bg-white">
      <div className="container-max">
        <motion.div
          ref={ref}
          initial={{ opacity: 0, y: 50 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8 }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl md:text-5xl font-bold text-secondary-900 mb-4">
            About Me
          </h2>
          <p className="text-xl text-secondary-600 max-w-3xl mx-auto">
            A passionate professional dedicated to creating innovative solutions and pushing the boundaries of what's possible.
          </p>
        </motion.div>

        <div className="grid lg:grid-cols-2 gap-12 items-center mb-16">
          {/* Left Column - Story */}
          <motion.div
            initial={{ opacity: 0, x: -50 }}
            animate={inView ? { opacity: 1, x: 0 } : {}}
            transition={{ duration: 0.8, delay: 0.2 }}
          >
            <div className="space-y-6">
              <h3 className="text-3xl font-bold text-secondary-900 mb-6">
                My Story
              </h3>
              <p className="text-lg text-secondary-600 leading-relaxed">
                With over 5 years of experience in software development and design, 
                I've had the privilege of working on diverse projects that have shaped 
                my approach to problem-solving and creativity.
              </p>
              <p className="text-lg text-secondary-600 leading-relaxed">
                I believe in the power of technology to transform ideas into reality, 
                and I'm constantly exploring new technologies and methodologies to 
                stay at the forefront of innovation.
              </p>
              <p className="text-lg text-secondary-600 leading-relaxed">
                When I'm not coding or designing, you'll find me exploring new 
                technologies, contributing to open-source projects, or sharing 
                knowledge with the developer community.
              </p>
            </div>
          </motion.div>

          {/* Right Column - Stats */}
          <motion.div
            initial={{ opacity: 0, x: 50 }}
            animate={inView ? { opacity: 1, x: 0 } : {}}
            transition={{ duration: 0.8, delay: 0.4 }}
            className="grid grid-cols-2 gap-6"
          >
            <div className="text-center p-6 bg-primary-50 rounded-lg">
              <div className="text-3xl font-bold text-primary-600 mb-2">5+</div>
              <div className="text-secondary-600">Years Experience</div>
            </div>
            <div className="text-center p-6 bg-secondary-50 rounded-lg">
              <div className="text-3xl font-bold text-secondary-600 mb-2">50+</div>
              <div className="text-secondary-600">Projects Completed</div>
            </div>
            <div className="text-center p-6 bg-primary-50 rounded-lg">
              <div className="text-3xl font-bold text-primary-600 mb-2">15+</div>
              <div className="text-secondary-600">Happy Clients</div>
            </div>
            <div className="text-center p-6 bg-secondary-50 rounded-lg">
              <div className="text-3xl font-bold text-secondary-600 mb-2">10+</div>
              <div className="text-secondary-600">Technologies</div>
            </div>
          </motion.div>
        </div>

        {/* Skills Section */}
        <motion.div
          initial={{ opacity: 0, y: 50 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8, delay: 0.6 }}
          className="mb-16"
        >
          <h3 className="text-3xl font-bold text-secondary-900 text-center mb-8">
            Skills & Technologies
          </h3>
          <div className="flex flex-wrap justify-center gap-3">
            {skills.map((skill, index) => (
              <motion.span
                key={skill}
                initial={{ opacity: 0, scale: 0.8 }}
                animate={inView ? { opacity: 1, scale: 1 } : {}}
                transition={{ duration: 0.3, delay: 0.8 + index * 0.1 }}
                className="px-4 py-2 bg-primary-100 text-primary-700 rounded-full font-medium hover:bg-primary-200 transition-colors duration-200"
              >
                {skill}
              </motion.span>
            ))}
          </div>
        </motion.div>

        {/* Values Section */}
        <motion.div
          initial={{ opacity: 0, y: 50 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8, delay: 0.8 }}
        >
          <h3 className="text-3xl font-bold text-secondary-900 text-center mb-12">
            What Drives Me
          </h3>
          <div className="grid md:grid-cols-3 gap-8">
            {values.map((value, index) => (
              <motion.div
                key={value.title}
                initial={{ opacity: 0, y: 30 }}
                animate={inView ? { opacity: 1, y: 0 } : {}}
                transition={{ duration: 0.6, delay: 1 + index * 0.2 }}
                className="text-center p-6 bg-white rounded-lg shadow-lg hover:shadow-xl transition-shadow duration-300"
              >
                <div className="w-12 h-12 bg-primary-100 rounded-lg flex items-center justify-center mx-auto mb-4 text-primary-600">
                  {value.icon}
                </div>
                <h4 className="text-xl font-semibold text-secondary-900 mb-3">
                  {value.title}
                </h4>
                <p className="text-secondary-600">
                  {value.description}
                </p>
              </motion.div>
            ))}
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default About;
